import React from 'react';
import TodoListItem from './todo-list-item';

const TodoList  = () => {
    return (
        <ul>
            <li><TodoListItem label="learn React 1"/></li>
            <li><TodoListItem 
            label="work 3"
            important
            /></li>
        </ul>
    );
};

export default TodoList;
